import React, { useState, useEffect } from "react";

function App() {
  const [employees, setEmployees] = useState([]);
  const [credentials, setCredentials] = useState([]);
  const [teams, setTeams] = useState([]);
  const [roles, setRoles] = useState([]);
  const [assignments, setAssignments] = useState([]);

  const [form, setForm] = useState({
    firstName: "",
    lastName: "",
    city: "",
    birthDate: "",
    email: "",
    teamId: "",   // seleccion
    roleId: ""    // seleccion
  });

  useEffect(() => {
    loadAll();
  }, []);

  const loadAll = () => {
    fetch("http://localhost:4000/employees").then(r=>r.json()).then(setEmployees).catch(e=>console.error(e));
    fetch("http://localhost:4000/credentials").then(r=>r.json()).then(setCredentials).catch(e=>console.error(e));
    fetch("http://localhost:4000/teams").then(r=>r.json()).then(setTeams).catch(e=>console.error(e));
    fetch("http://localhost:4000/roles").then(r=>r.json()).then(setRoles).catch(e=>console.error(e));
    fetch("http://localhost:4000/assignments").then(r=>r.json()).then(setAssignments).catch(e=>console.error(e));
  };

  const handleChange = (e) => setForm({ ...form, [e.target.name]: e.target.value });

  const handleSubmit = (e) => {
    e.preventDefault();
    // Convertir teamId/roleId vacÃ­os a null para backend
    const payload = {
      ...form,
      teamId: form.teamId === "" ? null : Number(form.teamId),
      roleId: form.roleId === "" ? null : Number(form.roleId),
    };

    fetch("http://localhost:4000/employees", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(payload),
    })
      .then((r) => r.json())
      .then((data) => {
        if (data.credentials) {
          alert(`Credenciales:\n${data.credentials.corpEmail}\n${data.credentials.password}`);
        }
        setForm({ firstName: "", lastName: "", city: "", birthDate: "", email: "", teamId: "", roleId: "" });
        loadAll();
      })
      .catch((err) => console.error("Error:", err));
  };

  return (
    <div style={{ padding: 20, fontFamily: "Arial" }}>
      <h1>GestiÃ³n de Empleados ðŸš€</h1>

      <form onSubmit={handleSubmit} style={{ display: "grid", gap: 8, maxWidth: 700 }}>
        <div style={{ display: "flex", gap: 8 }}>
          <input name="firstName" placeholder="Nombre" value={form.firstName} onChange={handleChange} required />
          <input name="lastName" placeholder="Apellido" value={form.lastName} onChange={handleChange} required />
        </div>
        <div style={{ display: "flex", gap: 8 }}>
          <input name="city" placeholder="Ciudad" value={form.city} onChange={handleChange} required />
          <input type="date" name="birthDate" value={form.birthDate} onChange={handleChange} required />
        </div>
        <input type="email" name="email" placeholder="Email personal" value={form.email} onChange={handleChange} required />

        <div style={{ display: "flex", gap: 8 }}>
          <select name="teamId" value={form.teamId} onChange={handleChange}>
            <option value="">-- Seleccionar equipo (opcional) --</option>
            {teams.map(t => <option key={t.id} value={t.id}>{t.name}</option>)}
          </select>

          <select name="roleId" value={form.roleId} onChange={handleChange}>
            <option value="">-- Seleccionar rol (opcional) --</option>
            {roles.map(r => <option key={r.id} value={r.id}>{r.name}</option>)}
          </select>
        </div>

        <button type="submit">Registrar empleado</button>
      </form>

      <hr />

      <h2>ðŸ“‹ Empleados</h2>
      <table border="1" width="100%" style={{ borderCollapse: "collapse", marginBottom: 12 }}>
        <thead><tr><th>ID</th><th>Nombre</th><th>Apellido</th><th>Ciudad</th><th>Nac</th><th>Email</th><th>Registro</th></tr></thead>
        <tbody>
          {employees.map(e => (
            <tr key={e.id}>
              <td>{e.id}</td><td>{e.firstName}</td><td>{e.lastName}</td><td>{e.city}</td><td>{e.birthDate}</td><td>{e.email}</td><td>{e.registrationDate}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h2>ðŸ”‘ Credenciales</h2>
      <table border="1" width="100%" style={{ borderCollapse: "collapse", marginBottom: 12 }}>
        <thead><tr><th>Nombre</th><th>Apellido</th><th>Email corp</th><th>Password</th></tr></thead>
        <tbody>
          {credentials.map((c,i) => (
            <tr key={i}><td>{c.firstName}</td><td>{c.lastName}</td><td>{c.email}</td><td>{c.password}</td></tr>
          ))}
        </tbody>
      </table>

      <h2>ðŸ‘¥ Asignaciones (employee â†’ team â†’ role)</h2>
      <table border="1" width="100%" style={{ borderCollapse: "collapse" }}>
        <thead><tr><th>#</th><th>Empleado</th><th>Equipo</th><th>Rol</th><th>Asignado</th></tr></thead>
        <tbody>
          {assignments.map(a => (
            <tr key={a.id}>
              <td>{a.id}</td>
              <td>{a.firstName} {a.lastName} (#{a.employeeId})</td>
              <td>{a.teamName}</td>
              <td>{a.roleName}</td>
              <td>{new Date(a.assignedAt).toLocaleString()}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
